GuaranteedAdGroupAdServiceDisplayUrlLevel:
  type: string
  nullable: true
  enum:
    - DOMAIN
    - FIRST_LEVEL
    - UNKNOWN
  title: GuaranteedAdGroupAdServiceDisplayUrlLevel
  description: |
    <div lang="ja">
    GuaranteedAdGroupAdServiceDisplayUrlLevelは、表示するURLの階層を表します。<br>
    このフィールドは、レスポンスの際に返却されますが、リクエストの際には無視されます。<br>
    ※現在利用できません
    </div>
    <div lang="en">
    GuaranteedAdGroupAdServiceDisplayUrlLevel describes a level of URL to display.<br>
    This field will be returned in the response, it will be ignored on input.<br>
    * Not Available.
    </div>
    <dl class=term>
      <dt class="term__item">DOMAIN</dt>
      <dd class="term__desc"><span lang="ja">ドメイン</span><span lang="en">Domain</span></dd>
      <dt class="term__item">FIRST_LEVEL</dt>
      <dd class="term__desc"><span lang="ja">第一階層</span><span lang="en">First level</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></dd>
    </dl>
